import React from "react";
import Auth from "../utils/Auth";
import { Route, Redirect } from "react-router-dom";

function PrivateRoute({ children, ...rest }) {
    let auth = Auth.loggedIn();
    console.log(auth);
    return (
      <Route
        {...rest}
        render={() => auth
          ? children
          : <Redirect to="/select" />
        }
      />
    );
}

export default PrivateRoute;
